  useEffect(() => {
    fetchAlert();
  }, []);

  const { data } = useSelector((state) => {
    console.log(data);
    return state.alert;
  });

  return (
    <div className=''>
      {/* {data.map((alert) => (
        <div key={alert.id} className={`alert alert-${alert.res.alertType}`}>
          {alert.res.msg}
        </div>
      ))} */}
      {data.length}
    </div>
  );
}

export default Alert;
